m.put("arena:howAreScoresCalculatedAnswer",new Escaped("""Yutuq 2 ball bersa durrang bir ball beradi. Mag'lubiyat esa hech qanday qiymatga ega emas va bal bermaydi. Agar siz ikki marta ketma-ket yutsangiz olov tasviri tushirilgan belgini yonib turishi orqali habar beriliuvchi 2 lik ballar seriyasini olishni boshlagan bo'lasiz. Ushbu ikkiliklar seriyasi toki siz mag'lub bo'lguningizcha davom etadi. Bu o'z navbatida g'alaba 4 ball, durrang 2 ball va mag'lubiyat esa avvalgidek hech narsa bermasligini anglatadi. 

Masalan, ikkita yutuq va bitta durrang 6 ball bergan bo'lardi: 2 + 2 + (2 x 1)""","""Yutuq 2 ball bersa durrang bir ball beradi. Mag&#39;lubiyat esa hech qanday qiymatga ega emas va bal bermaydi. Agar siz ikki marta ketma-ket yutsangiz olov tasviri tushirilgan belgini yonib turishi orqali habar beriliuvchi 2 lik ballar seriyasini olishni boshlagan bo&#39;lasiz. Ushbu ikkiliklar seriyasi toki siz mag&#39;lub bo&#39;lguningizcha davom etadi. Bu o&#39;z navbatida g&#39;alaba 4 ball, durrang 2 ball va mag&#39;lubiyat esa avvalgidek hech narsa bermasligini anglatadi. <br /><br />Masalan, ikkita yutuq va bitta durrang 6 ball bergan bo&#39;lardi: 2 + 2 + (2 x 1)"""))
m.put("arena:berserk",new Simple("""Berserk maydoni"""))
m.put("arena:berserkAnswer",new Escaped("""Qachon o'yinchi Berserk tugmasini bossa o'yin boshlanadi va u o'zining yarim vaqtini yo'qotadi, ammo yutuq yana bir qo'shimcha turnir balini olib keladi. 

