Berserk boshlang'ich vaqti 0 bo'lgan o'yinlar uchun yopiq (0+1, 0+2).

Berserk qo'shimcha bali faqat 7 yurishdan keyingina beriladi.""","""Qachon o&#39;yinchi Berserk tugmasini bossa o&#39;yin boshlanadi va u o&#39;zining yarim vaqtini yo&#39;qotadi, ammo yutuq yana bir qo&#39;shimcha turnir balini olib keladi. <br /><br />Berserkka vaqtni oshirishni boshqaruvi orqali o&#39;tish ham oshirishni bekor qiladi. (1+2 hisoblanmaydi, 1+0 beradi) <br /><br />Berserk boshlang&#39;ich vaqti 0 bo&#39;lgan o&#39;yinlar uchun yopiq (0+1, 0+2).<br /><br />Berserk qo&#39;shimcha bali faqat 7 yurishdan keyingina beriladi."""))
